var socket;
var drawingColor;

var num = 500;
var counter = 0;
var mx = [];
var my = [];
var pos = 0;

var permanentArrayX = [];
var permanentArrayY = [];

function setup() {
  createCanvas(1250, 600);
  socket = io.connect('http://192.168.0.100:3000')
  socket.on('mouse', newDrawing);
  noStroke();
}

function newDrawing(data) {
  //partner's drawing
  
  for (var i = 0; i < num; i++)  {
    fancy(data.x, data.y, i);
    
    //if the difference is too big, make it red
    if (abs (data.x-mouseX) > 50 && abs (data.y - mouseY) > 50 ){
    fill(255,0,0);
    }
    
    //otherwise, gradiate towards magenta
    else{
    drawingColor = (255-(abs(data.x-mouseX))+abs(data.y - mouseY));
    fill(drawingColor,0,255);
    }
  }
}

function mouseDragged() {
  // own drawing

  var data = {
    x: mouseX,
    y: mouseY
  }

  socket.emit('mouse', data);
  noStroke();
  fill (drawingColor, 0, 255);
  ellipse(mouseX, mouseY, 35, 35);
}

function draw() {
   background(51,50);
}

function fancy(dataX, dataY, i) {
  // Cycle through the array, using a different entry on each frame. 
  // Using modulo (%) like this is faster than moving all the values over.
  var which = counter % num;
  
  mx[which] = dataX;
  my[which] = dataY;

    // which+1 is the smallest (the oldest in the array)
    var index = (which + 1 + i) % num;
    ellipse(mx[index], my[index], 35, 35);
    counter ++;
    
}

